import axios from 'axios';
import React, { Component } from 'react'
import Data from './cars.json';

export class Audi extends Component {

    state = {
        carsAudi: []
    }


    componentDidMount() {

        fetch(Data)
        .then(resp => {
            console.log(resp);
        })
    }


    render() {
        return (
            <div>
                <div className="container mt-5 pt-5">
                    <div className="row">
                        {this.state.carsAudi.map(car =>
                        
                            <div>
                                <h2>{car.title}</h2>
                                <p>{car.body}</p>
                            </div>
                        )}
                        
                    </div>
                </div>
            </div>
        )
    }
}

export default Audi
